<style type="text/less" lang="less">
  html, body{
    height: 100%;
  }
  .of{
    overflow: hidden;
  }
  .fl{
    float: left;
  }
  .bg{
    min-height: 100%;
    background-color: #FE5555;
    text-align: center;
    z-index: 0;
    padding-bottom: 20px;
    .bg-top{
      position: absolute;
      top: 70px;
      left: 50%;
      -webkit-transform: translateX(-50%);
      -moz-transform: translateX(-50%);
      -ms-transform: translateX(-50%);
      -o-transform: translateX(-50%);
      transform: translateX(-50%);
      display: inline-block;
      width: 300px;
      height: 183px;
      z-index: 1;
    }
    .doubt{
      position: absolute;
      width: 20px;
      height: 20px;
      right: 20px;
      top: 80px;
      z-index: 5;
    }
    .coupon-list{
      z-index: 1;
      position: relative;
      padding-top: 229px;
      .coupon-cell{
        position: relative;
        text-align: left;
        margin: 0 auto 15px;
        width: 335px;
        height: 125px;
        background: url(data:image/png;base64,) no-repeat;
        background-size: contain;
        .cell-top{
          padding-top: 10px;
          margin-left: 30px;
          .coupon-total{
            color: #EE4C4C;
            font-size: 48px;
            line-height: 48px;
            margin-right: 10px;
          }
          .more{
            line-height: 15px;
            font-size: 15px;
            color: #121212;
          }
        }
        .cell-bottom{
          margin-top: 15px;
          margin-left: 40px;
          font-size: 13px;
          color: #666;
        }
        .catch-btn{
          position: absolute;
          right: 0;
          top: 50%;
          margin-top: -15px;
          width: 100px;
          height: 30px;
          background: url(data:image/png;base64,) no-repeat;
          background-size: cover;
          color: white;
          line-height: 30px;
          text-align: center;
          &.use{
            background-image: url(data:image/png;base64,);
          }
          &.null{
            background-image: url(data:image/png;base64,);
          }
        }
        .catch-begin{
          position: absolute;
          top: 13px;
          right: 20px;
          font-size: 13px;
          color: #ED2121;
        }
      }
      .coupon-cell.null{
        background-image: url(data:image/png;base64,);
      }
      .coupon-cell.got{
        background-image: url(data:image/png;base64,);
      }
    }
  }
</style>
<template>
  <!-- :style="{minHeight: clientHeight}" -->
  <div class="bg" :style="{backgroundColor: couponConfig.coupon_color ? couponConfig.coupon_color  : '#FE5555'}">
    <scroller delegate-id="myScroller"
              :on-refresh="refresh"
              refreshLayerColor="white"
              loadingLayerColor="white"
              ref="my_scroller">
      <block v-if="couponConfig.coupon_image">
        <img class="bg-top" :src="couponConfig.coupon_image"/>
      </block>
      <block v-else-if="couponConfig.coupon_image != null">
        <img class="bg-top" src="../../assets/img/bg_voucher@2x.png"/>
      </block>
      <!--  src="../../assets/img/bg_voucher@2x.png" -->
      <img @click="doubt" src="../../assets/img/icon_doubt@3x.png" class="doubt"/>
      <div class="coupon-list">
        <div v-for="item in couponList" :key="item.coupon_id" class="coupon-cell" :class="{'null': item.status==3, 'got': item.status==2}">
          <div class="cell-top of">
            <span class="coupon-total fl">{{item.total}}</span>
            <div class="more fl">
              <div style="margin-top: 5px;">{{item.coupon_type}}</div>
              <div style="margin-top: 10px;">满{{item.limitTotal}}元可使用</div>
            </div>
          </div>
          <div class="cell-bottom">
            <div>·全场通用</div>
            <div style="margin-top: 5px;color: #ED2121">·{{item.showBottom}}</div>
          </div>
          <div v-if="item.overdue" class="catch-btn null">已过期</div>
          <div v-else-if="item.status===0" class="catch-btn null" @click="receive(item);">未开始</div>
          <div v-else-if="item.status===1" class="catch-btn" @click="receive(item);">立即领取</div>
          <div v-else-if="item.status===2" class="catch-btn use" @click="receive(item);">立即使用</div>
          <div v-else-if="item.status===3" class="catch-btn null" @click="receive(item);">进入商城</div>
          <!--<div class="catch-begin" v-if="item.status===0">开抢时间:{{item.catchTime}}</div>-->
        </div>
      </div>
    </scroller>
  </div>
</template>

<script>
  import Vue from 'vue'
  import VueScroller from 'vue-scroller'
  Vue.use(VueScroller)

  export default {
    data () {
      return {
        couponList: [
        ],
        couponConfig: {
          coupon_image: null,
          coupon_color: "#FE5555"
        }
      }
    },
    computed: {
      clientHeight() {
        console.log("document.body.clientHeight: ------------------------")
        console.log(document.body.clientHeight);
        return document.body.clientHeight + "px";
      },
      catchBg() {
        let nullBg = require("../../assets/img/btn_null@2x.png");
        let useBg = require("../../assets/img/btn_use@2x.png");
        let defaultBg = require("../../assets/img/btn_receive@2x.png");
        return {
          null: nullBg,
          use: useBg,
          default: defaultBg
        };
      }
    },
    methods: {
      receive(it) {
        if (it.status === 1) {
          let param = {};
          param.coupon_id = it.coupon_id;
          this.$post(URL.drawCoupon, param)
            .then(res => {
              console.log('drawCoupon: ');
              console.log(res);
              toast('领取成功');
              this._getCoupons();
            })
        } else if(it.status == 2 || it.status == 3) {
          openPage("mall", {});
        } else {
          openPage("mall", {});
        }
      },
      _getCoupons() {
        // alert("_getCoupons");
        let param = {};
        let _this = this;
        this.$post(URL.canGetCoupon, param)
          .then(res => {
            // alert("canGetCoupon");
            console.log('canGetCoupon');
            console.log(res);
            _this._normalizeCoupons(res.content);
            _this.$refs.my_scroller.finishPullToRefresh();
          })
      },
      _normalizeCoupons(list) {
        // alert("_normalizeCoupons");
        const retList = [];
        const tList = list;
        for (let i in tList) {
          alert("step");
          console.log("???????????????????????????");
          alert(i);
          let item = tList[i];
          alert(JSON.stringify(item));
          let ret = this._getRet(item);
          alert(JSON.stringify(ret));
          retList.push(ret)
        }
        alert("step4");
        // console.log(retList)
        this.couponList = retList;
        // console.log('_normalizeCoupons');
        // console.log(retList);
      },
      _getRet(item) {
        item.start_type = parseInt(item.start_type);
        const ret = {};
        ret.coupon_id = item.coupon_id;
        ret.total = parseFloat(item.amount);
        ret.name = item.name;
        ret.limitTotal = parseFloat(item.limit);
        alert("step1");
        if(item.start_type === 1 && item.start_time !== null) {
          let startDate = new Date();
          startDate.setTime(item.start_time * 1000);
          // ret.timeStart = `${startDate.getFullYear()}.${startDate.getMonth()+1}.${startDate.getDate()} ${startDate.getHours()}:${startDate.getMinutes()}`;
          ret.timeStart = startDate.getFullYear() + "." + (startDate.getMonth()+1) + "." + startDate.getDate() + " " + startDate.getHours() + ":" + startDate.getMinutes();
          let endDate = new Date();
          endDate.setTime((parseInt(item.start_time) + parseInt(item.date_expire)) * 1000);
          // ret.timeEnd = `${endDate.getFullYear()}.${endDate.getMonth()+1}.${endDate.getDate()} ${endDate.getHours()}:${endDate.getMinutes()}`;
          ret.timeEnd = endDate.getFullYear() + "." + (endDate.getMonth()+1) + "." + endDate.getDate() + " " + endDate.getHours() + ":" + endDate.getMinutes();
          // ret.showBottom = `${ret.timeStart}~${ret.timeEnd}可使用`;
          ret.showBottom = ret.timeStart + "~" + ret.timeEnd + "可使用";
        } else {
          let cutDate = item.date_expire / 3600 / 24;
          // ret.showBottom = `领取后${cutDate > 0 ? cutDate : ''}天内可使用`;
          ret.showBottom = "领取后" + (cutDate > 0 ? cutDate : '') + "天内可使用";
        }
        alert("step2");
        // console.log('first: ' + ret.showBottom);
        let startDate = new Date();
        startDate.setTime(item.get_start * 1000);
        // ret.catchTime = `${startDate.getFullYear()}.${startDate.getMonth()+1}.${startDate.getDate()} ${startDate.getHours()}:${startDate.getMinutes()}:${startDate.getSeconds()}`;
        ret.catchTime = startDate.getFullYear() + "." + (startDate.getMonth()+1) + "." + startDate.getDate() + " " + startDate.getHours() + ":" + startDate.getMinutes() + ":" + startDate.getSeconds();
        // 1.剩余可领取总数 2.有效期
        ret.status = this._fixState(item);
        if(ret.status == 0) {
          // ret.showBottom = `开抢时间:${ret.catchTime}`;
          ret.showBottom = "开抢时间:" + ret.catchTime;
        }
        alert("step3");
        // console.log('second: ' + ret.showBottom);
        // ret.coupon_type = ret.status === 0 ? item.name.substring(0, 3) + '...' : ret.name;
        ret.coupon_type = item.name;
        ret.overdue = false;

        if(item.start_type === 1 && item.start_time != null) {
          // 已过期
          let endDate = new Date();
          endDate.setTime((parseInt(item.start_time) + parseInt(item.date_expire)) * 1000);
          if (endDate.getTime() < new Date().getTime()) {
            ret.overdue = true;
          }
        }
        return ret;
      },
      _fixState(item) {
        alert("_fixState");
        let currentTimestamp = new Date().getTime() / 1000;
        if(item.already_get === 1) {
          return 2;
        }else if (parseInt(item.total) <= 0) {
          return 3;
        }
        // console.log('item.already_get === 0: ' + (item.already_get === 0))
        // console.log('item.item.get_start <= currentTimestamp: ' + (item.get_start <= currentTimestamp))
        // console.log('item.item.get_end >= currentTimestamp: ' + (item.get_end >= currentTimestamp))
        if (item.get_start > currentTimestamp) {
          return 0;
        } else if(item.already_get === 0 && item.get_start <= currentTimestamp && item.get_end >= currentTimestamp) {
          return 1;
        }
        // else if(item.get_end < currentTimestamp && item.already_get === 0) {
        //   return 3;
        // }
      },
      refresh() {
        this._getCoupons()
      },
      doubt() {
        openPage("coupon_doubt", {});
      },
      fetch() {
        this.$post(URL.couponConfig)
          .then(res => {
            if (res.errcode == 0) {
              this._setConfig(res.content);
            } else {
              errback(res);
            }
          })
      },
      _setConfig(data) {
        this.couponConfig = data;
      }
    },
    created() {
      this.fetch();
      this._getCoupons();
    },
    mounted() {

    },
    components: {

    }
  }
</script>
